function CreateSkills() {
    return (
        <section className={cx("warpper")}>
            <Input
                name="Title Skills"
                type="text"
                required={true}
                id="TitleSkills"
                onChange={(e) => {}}
            />
            <Input
                name="Content Skills"
                type="text"
                required={true}
                id="ContentSkills"
                onChange={(e) => {}}
            />
            
        </section>
    );

}
 export default CreateSkills;
